entry.value:
import groovy.json.JsonSlurper

def flowFile = session.get()
if (!flowFile) return

try {
    def jsonText = session.read(flowFile).getText('UTF-8')
    def jsonSlurper = new JsonSlurper()
    def jsonData = jsonSlurper.parseText(jsonText)

    // Check if this is the database record we want
    if (jsonData.containsKey('message') && jsonData.containsKey('tables')) {
        // This is our target FlowFile - transfer to success
        flowFile = session.putAttribute(flowFile, 'record.type', 'database')
        session.transfer(flowFile, REL_SUCCESS)
    } else {
        // This is not our target - transfer to failure or different relationship
        flowFile = session.putAttribute(flowFile, 'record.type', 'other')
        session.transfer(flowFile, REL_FAILURE)
    }
} catch (Exception e) {
    log.error("Error processing JSON", e)
    session.transfer(flowFile, REL_FAILURE)
}
